selector_to_html = {"a[href=\"#question-3-the-scanner-scans-successfully-beeps-three-times-and-fails-to-upload-data-how-can-i-solve-this-problem\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Question 3:Le scanner scanne avec succ\u00e8s, bip trois fois et ne t\u00e9l\u00e9charge pas de donn\u00e9es. Comment puis-je r\u00e9soudre ce probl\u00e8me ?<a class=\"headerlink\" href=\"#question-3-the-scanner-scans-successfully-beeps-three-times-and-fails-to-upload-data-how-can-i-solve-this-problem\" title=\"Lien vers cette rubrique\">#</a></h2><p><strong>R\u00e9ponse:</strong></p>", "a[href=\"#question-5-scan-successful-uploaded-data-incorrect\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Question 5:Scan r\u00e9ussi, donn\u00e9es t\u00e9l\u00e9charg\u00e9es incorrectes ?<a class=\"headerlink\" href=\"#question-5-scan-successful-uploaded-data-incorrect\" title=\"Lien vers cette rubrique\">#</a></h2><p><strong>R\u00e9ponse:</strong></p>", "a[href=\"wireless.html#one-to-one-pairing\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Appairage unique<a class=\"headerlink\" href=\"#one-to-one-pairing\" title=\"Lien vers cette rubrique\">#</a></h2>", "a[href=\"#question-1-the-scan-is-successful-the-buzzer-sounds-once-but-no-data-is-uploaded\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Question 1 : Le scan est r\u00e9ussi, le buzzer sonne une fois, mais aucune donn\u00e9e n\u2019est t\u00e9l\u00e9charg\u00e9e ?<a class=\"headerlink\" href=\"#question-1-the-scan-is-successful-the-buzzer-sounds-once-but-no-data-is-uploaded\" title=\"Lien vers cette rubrique\">#</a></h2><p><strong>R\u00e9ponse:</strong> Le scanner est entr\u00e9 en mode stockage et doit scanner <a class=\"reference internal\" href=\"working.html#normal-mode\"><span class=\"std std-ref\">Mode Normal</span></a> pour r\u00e9cup\u00e9rer.</p>", "a[href=\"#question-2-the-scanner-scans-successfully-beeps-twice-and-can-upload-data-normally-what-is-going-on\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Question 2 : Le scanner scanne avec succ\u00e8s, bips deux fois et peut t\u00e9l\u00e9charger des donn\u00e9es normalement. Que se passe-t-il ?<a class=\"headerlink\" href=\"#question-2-the-scanner-scans-successfully-beeps-twice-and-can-upload-data-normally-what-is-going-on\" title=\"Lien vers cette rubrique\">#</a></h2><p><strong>R\u00e9ponse:</strong> La batterie du pistolet du scanner est faible et il invite \u00e0 le recharger.</p>", "a[href=\"#faq\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Foire Aux Questions<a class=\"headerlink\" href=\"#faq\" title=\"Lien vers cette rubrique\">#</a></h1><h2>Question 1 : Le scan est r\u00e9ussi, le buzzer sonne une fois, mais aucune donn\u00e9e n\u2019est t\u00e9l\u00e9charg\u00e9e ?<a class=\"headerlink\" href=\"#question-1-the-scan-is-successful-the-buzzer-sounds-once-but-no-data-is-uploaded\" title=\"Lien vers cette rubrique\">#</a></h2><p><strong>R\u00e9ponse:</strong> Le scanner est entr\u00e9 en mode stockage et doit scanner <a class=\"reference internal\" href=\"working.html#normal-mode\"><span class=\"std std-ref\">Mode Normal</span></a> pour r\u00e9cup\u00e9rer.</p>", "a[href=\"#question-4-the-scanner-beeps-five-times-when-a-button-is-pressed-how-can-i-solve-this-problem\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Question 4 : Le scanner \u00e9met cinq bips lorsqu\u2019un bouton est press\u00e9, comment puis-je r\u00e9soudre ce probl\u00e8me?<a class=\"headerlink\" href=\"#question-4-the-scanner-beeps-five-times-when-a-button-is-pressed-how-can-i-solve-this-problem\" title=\"Lien vers cette rubrique\">#</a></h2><p><strong>R\u00e9ponse:</strong> La batterie est faible et doit \u00eatre recharg\u00e9e avant de pouvoir \u00eatre r\u00e9utilis\u00e9e.</p>", "a[href=\"working.html#normal-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Mode Normal<a class=\"headerlink\" href=\"#normal-mode\" title=\"Lien vers cette rubrique\">#</a></h2>"}
